import React from 'react';
import { Navigate, useLocation } from 'react-router';

const PrivateRoute = ({ children }) => {
    const user = false

    if (!user) {
        return <Navigate to="/pages/login" replace={true} state={{
            return_url: location.pathname
        }} />
    }

    return children

};

export default PrivateRoute;
